25	铺地毯	<p>为了准备一个独特的颁奖典礼，组织者在会场的一片矩形区域（可看做是平面直角坐标系的第一象限）铺上一些矩形地毯。一共有n张地毯，编号从1到n。现在将这些地毯按照编号从小到大的顺序平行于坐标轴先后铺设，后铺的地毯覆盖在前面已经铺好的地毯之上。地毯铺设完成后，组织者想知道覆盖地面某个点的最上面的那张地毯的编号。注意：在矩形地毯边界和四个顶点上的点也算被地毯覆盖。</p>	<p>第一行一个整数n，表示总共有n张地毯。</p><p>接下来的n行中，第i+1行表示编号i的地毯信息，包含四个正整数a，b，g，k，每两个整数之间用一个空格隔开，分别表示铺设地毯的左下角坐标（a，b）以及地毯在x轴和y 轴方向的长度。</p><p>第n+2行包含两个正整数x和y，表示所求的地面的点的坐标（x，y）。</p>	<p>输出一行一个整数，表示所求的地毯的编号；若此处没有被地毯覆盖，则输出-1。</p>	[{"input": "3\\n1 0 2 3\\n0 2 3 3\\n2 1 3 3\\n2 2", "output": "3"}]	89f12d51b7919894546d6c6f659c4022	[{"score": 10, "input_name": "1.in", "output_name": "1.out"}, {"score": 10, "input_name": "2.in", "output_name": "2.out"}, {"score": 10, "input_name": "3.in", "output_name": "3.out"}, {"score": 10, "input_name": "4.in", "output_name": "4.out"}, {"score": 10, "input_name": "5.in", "output_name": "5.out"}, {"score": 10, "input_name": "6.in", "output_name": "6.out"}, {"score": 10, "input_name": "7.in", "output_name": "7.out"}, {"score": 10, "input_name": "8.in", "output_name": "8.out"}, {"score": 10, "input_name": "9.in", "output_name": "9.out"}, {"score": 10, "input_name": "10.in", "output_name": "10.out"}]	<p><span style="font-size: 12pt;"><font>【样例解释】</font></span></p><p><span style="font-size: 12pt;"><font>如图</font></span><span style="font-size: 12pt;">5-8-1</span><span style="font-size: 12pt;"><font>，</font>1号地毯用实线表示，2号地毯用虚线表示，3号用双实线表示，覆盖点（2,2）的最上面一张地毯是3号地毯。</span></p><p><img alt="铺地毯.png" src="/public/upload/c136531992.png" width="342" height="311" /><br /></p><p>【数据规模】 <br /></p><p>对于30%的数据满足：n≤2； <br /></p><p>   对于50%的数据满足：0≤a，b，g，k≤100；</p><p>对于100%的数据满足：0≤n≤10000，0≤a，b，g，k≤100000。</p>	["Java", "C", "Python2", "Python3", "C++"]	{}	2018-03-17 03:43:18.120707+00	\N	1000	256	f	\N	\N	\N	OI	t	Low		22	15	1	P1060	{"0": 15, "4": 4, "8": 2, "-2": 1}	100	2	t	f
