17	FBI树	<p>我们可以把由“0”和“1”组成的字符串分为三类：全“0”串称为B串，全“1”串称为I串，既含“0”又含“1”的串则称为F串。</p><p>FBI树是一种二叉树[ 二叉树：二叉树是结点的有限集合，这个集合或为空集，或由一个根结点和两棵不相交的二叉树组成。这两棵不相交的二叉树分别称为这个根结点的左子树和右子树。]，它的结点类型也包括F结点，B结点和I结点三种。由一个长度为2N的“01”串S可以构造出一棵FBI树T，递归的构造方法如下：</p><p>1)T的根结点为R，其类型与串S的类型相同；2)若串S的长度大于1，将串S从中间分开，分为等长的左右子串S1和S2；由左子串S1构造R的左子树T1，由右子串S2构造R的右子树T2。</p><p>现在给定一个长度为2N的“01”串，请用上述构造方法构造出一棵FBI树，并输出它的后序遍历[ 后序遍历：后序遍历是深度优先遍历二叉树的一种方法，它的递归定义是：先后序遍历左子树，再后序遍历右子树，最后访问根。]序列。</p>	<p>第一行是一个整数N（0 &lt;= N &lt;= 10），第二行是一个长度为2$a^{N}$次方的“01”串。</p>	<p>这一行只包含一个字符串，即FBI树的后序遍历序列。</p>	[{"input": "3\\n10001011", "output": "IBFBBBFIBFIIIFF"}]	98f37b8577a22b57bb2bf5817e3cf114	[{"score": 10, "input_name": "1.in", "output_name": "1.out"}, {"score": 10, "input_name": "2.in", "output_name": "2.out"}, {"score": 10, "input_name": "3.in", "output_name": "3.out"}, {"score": 10, "input_name": "4.in", "output_name": "4.out"}, {"score": 10, "input_name": "5.in", "output_name": "5.out"}, {"score": 10, "input_name": "6.in", "output_name": "6.out"}, {"score": 10, "input_name": "7.in", "output_name": "7.out"}, {"score": 10, "input_name": "8.in", "output_name": "8.out"}, {"score": 10, "input_name": "9.in", "output_name": "9.out"}, {"score": 10, "input_name": "10.in", "output_name": "10.out"}]	<p>【数据规模】</p><p>对于40%的数据，N &lt;= 2；</p><p>对于全部的数据，N &lt;= 10。</p>	["Java", "C", "Python2", "Python3", "C++"]	{}	2018-03-16 03:21:24.283743+00	\N	1000	256	f	\N	\N	\N	ACM	t	Mid		3	3	1	P2007	{"0": 3}	0	\N	f	f
